u=pl('<div data-v-6dae5d1e><div class="section grid" data-v-6dae5d1e><p class="font-white title" data-v-6dae5d1e>Never transcribe manually again</p><p class="content" data-v-6dae5d1e> Tanscribe clips from any Avid Media Composer project with ease. Say goodbye to the hassle of exporting to Quicktimes or uploading clips one-by-one to a subpar prosumer tool. Made for professionals, by professionals. </p><div class="section_center" data-v-6dae5d1e><div class="mailinput" data-v-6dae5d1e><input placeholder="Enter your email" data-v-6dae5d1e><button data-v-6dae5d1e>Request Beta Access</button></div></div></div><div class="section section_2" data-v-6dae5d1e><img src="'+bu+'" alt="image" data-v-6dae5d1e></div><div class="section section_3" data-v-6dae5d1e><p data-v-6dae5d1e>EdMon speeds up your transcribing, searching and pre-editing of video, saving you hours of work.</p><div class="watch_btn_t" data-v-6dae5d1e><img src="'+yu+'" alt="image" data-v-6dae5d1e><h5 data-v-6dae5d1e>Watch video</h5></div></div><div class="section V_display even section_4" data-v-6dae5d1e><img src="'+Eu+'" alt="Mask group (1)" data-v-6dae5d1e><div data-v-6dae5d1e><h3 data-v-6dae5d1e>Batch transcribe</h3><p data-v-6dae5d1e>With just a few clicks, you can open an Avid project file, select the clips you want to transcribe, and in minutes, you/&#39;ll have fully transcribed text available on our cloud-based platform.</p></div></div><div class="section V_display odd section_5" data-v-6dae5d1e><div data-v-6dae5d1e><h3 data-v-6dae5d1e>Online access</h3><p data-v-6dae5d1e>The transcribed video is stored on our cloud platform, accessible from anywhere and organized in a way that matches your Media Composer project.</p></div><img src="'+wu+'" alt="Mask group(1)" data-v-6dae5d1e></div><div class="section V_display even section_6" data-v-6dae5d1e><img src="'+xu+'" alt="Mask group(1)" data-v-6dae5d1e><div data-v-6dae5d1e><h3 data-v-6dae5d1e>Text based editing</h3><p data-v-6dae5d1e>Browse through the text, pick and choose the parts you want, and add them to a rough cut. The process of editing is now faster and more efficient, allowing you to search and select in text instead of video. Finally, export your selections as an AAF file and seamlessly integrate them back into Media Composer.</p></div></div><div class="section V_display odd section_7" data-v-6dae5d1e><div data-v-6dae5d1e><h3 data-v-6dae5d1e>Roundtrip from MC to EdMon (and back)</h3><p data-v-6dae5d1e>Enjoy the convenience of editing a rough cut in text instead of video, and send your final product back to Media Composer for fine-tuning. With our AAF exports, you&#39;ll be able to link back to your original Media Composer clips instantly.</p></div><img src="'+Cu+'" alt="Mask group (1)" data-v-6dae5d1e></div><div class="section learn grid" data-v-6dae5d1e><h1 data-v-6dae5d1e>Less pain - more editing.</h1><p data-v-6dae5d1e> EdMon is a professional tool specifically designed for Avid editors. It can transcribe multiple video files in one go, created for editors who need to transcribe large volumes of video content (like hours of interviews for a documentary). <br data-v-6dae5d1e> In short, EdMon is the ideal solution for Avid editors who need to transcribe large amounts of video content quickly and efficiently. Less pain - more editing. </p><div class="section_center" data-v-6dae5d1e><div class="mailinput" data-v-6dae5d1e><input placeholder="Enter your email" data-v-6dae5d1e><button data-v-6dae5d1e>Request Beta Access</button></div></div></div></div>',1),Ou=[Mu];function Iu(e,t){return ds(),hs("div",Pu,Ou)}const Tu=vs(Ru,[["render",Iu],["__scopeId","data-v-6dae5d1e"]]),Su=qc({history:fc("/"),routes:[{path:"/",name:"home",component:Tu},{path:"/about",name:"about",component:()=>Au(()=>import("./AboutView-695cf565.js"),["assets/AboutView-695cf565.js","assets/AboutView-4d995ba2.css"])}]});const Ao=Wl(mu);Ao.use(Su);Ao.mount("#app");export{vs as _,Z as a,hs as c,ds as o};
